import './Dashboard.scss';
import { Fragment, useEffect, useState } from 'react';
import axios from "axios";

import { API_URL, API_IMAGES } from '../../api/api.js';

function Dashboard() {
  const [data, setData] = useState(false)
  useEffect(()=>{
      axios.get(API_URL).then(data => {
        setData(data.data)
        console.log(data.data)
      })

  },[])
  return (
    <>
        {
        data  &&  
          <div className='dashboard'>
            <h1>Dashboard</h1>
            <h2>
              <span className='dashboard__count'>{data.count}&nbsp;</span>
              <span className='dashboard__span'> reports generated today</span>
            </h2>
            <h3>Reports</h3>
            <div className='dashboard__container'>
              <div className='dashboard__choose'>
                <div className='dashboard__tabs'>
                  <span>Date</span>
                  <span>Status</span>
                  <span>Camera</span>
                  <span>Algorithm</span>
                  <span>Sort: Newest</span>
                </div>
                <div className='dashboard__reports'>
                  {data && data.results.map((el)=>{
                    return (
                      <div className='dashboard__reports_item' key={el.id}>

                      </div>
                    )
                  })}
                </div>
              </div>

            </div>
          </div>
     }
    </>

  );
}

export default Dashboard;
